export class ASCIICoreSettings {
    constructor() {
        this.optimized = true;
        this.quality = 'high';
        this.fontFace = 'monospace';
        this.fontWidth = 40;
        this.fontHeight = 70;
        this.fontBlur = 6;
        this.lutWidth = 5;
        this.lutHeight = 7;
        this.lutPadding = 1;
        this.brightness = 1;
        this.gamma = 1;
        this.noise = 0;
    }
}
